package teammate.teammate.domain;import jakarta.persistence.*;import lombok.AllArgsConstructor;import lombok.Getter;import lombok.NoArgsConstructor;import lombok.Setter;@Entity@Getter@Setter@NoArgsConstructor@AllArgsConstructor@Table(name = "user_skills")public class UserSkill {	@Id	@GeneratedValue(strategy = GenerationType.IDENTITY)	private Long id;	@ManyToOne	@JoinColumn(name = "user_id", nullable = false)	private UserProfile userProfile;	@Column(nullable = false, length = 50)	private String skill;}